import iheartradio from "../assests/images/iheartradio.svg";
import { Icon } from '@iconify/react';
const Homecomponent = () =>{
    return(
        <div className="h-full w-full flex">
            <div className="h-full w-1/5 bg-black">
                {/* div for logo */}
                <div className="p-2"> 
                 {/* <img src={iheartradio} alt="iheartlogo" /> */}
                 <Icon icon="simple-icons:iheartradio" width={80} />
                </div>
            </div>

            <div className="h-full">

            </div>
        </div>
    );
};

export default Homecomponent;
